import React from "react";
import './App.css';
const Resultado =({dato})=>
{
    return(
<>   
     <div className="App">
            <h1>
                {dato.nombres}
                {dato.apellidos}
                {dato.sexo}
                {dato.dui}
                {dato.fechaNacimiento}
                {dato.direccion}
                {dato.municipio}
                {dato.departamento}
            </h1>
            </div>
</>
    );

}

export default Resultado
